['Q: People API를 사용하기 위해 사전 준비해야 할 단계는 무엇인가요?
A: People API를 사용하기 위해서는 [People API 사용 준비하기](https://developers.google.com/people/v1/getting-started?hl=ko) 문서의 단계를 완료해야 합니다. 이 단계를 완료하면 프로필의 데이터를 읽을 준비가 됩니다.', 'Q: People API의 최종 수정일은 언제인가요?
A: People API의 최종 수정일은 2015년 11월 23일입니다.', 'Q: People API를 사용하여 사용자 연결을 요청하는 방법은 무엇인가요?
A: 다음 코드를 사용하여 사용자 연결을 요청할 수 있습니다:

```java
ListConnectionsResponse response = service.people().connections()
    .list("people/me")
    .setPageSize(10)
    .setPersonFields("names,emailAddresses")
    .execute();
```', 'Q: People API에 대한 지원은 어디에서 받을 수 있나요?
A: People API에 대한 지원은 [https://developers.google.com/people/support?hl=ko](https://developers.google.com/people/support?hl=ko)에서 받을 수 있습니다.', 'Q: People API를 호출하여 연결된 사람들의 이름을 출력하는 방법은 무엇인가요?
A: People API를 호출하여 연결된 사람들의 이름을 출력하는 방법은 quickstart.py 파일의 다음 코드 블록을 사용하여 구현할 수 있습니다.

```python
results = (
    service.people()
    .connections()
    .list(
        resourceName="people/me",
        pageSize=10,
        personFields="names,emailAddresses",
    )
    .execute()
)
connections = results.get("connections", [])

for person in connections:
  names = person.get("names", [])
  if names:
    name = names[0].get("displayName")
    print(name)
```', 'Q: Python에서 People API 클라이언트 라이브러리를 시작하는 방법은 무엇인가요?
A: 이 페이지에는 다음을 사용하여 People API를 시작하는 방법에 대한 정보가 포함되어 있습니다.
Python용 Google API 클라이언트 라이브러리입니다.', "Q: People API를 사용하여 첫 10명의 연결 이름을 가져오는 방법은 무엇인가요?
A: People API를 사용하여 첫 10명의 연결 이름을 가져오는 코드는 다음과 같습니다:
```javascript
async function listConnectionNames() {
  let response;
  try {
    response = await gapi.client.people.people.connections.list({
      'resourceName': 'people/me',
      'pageSize': 10,
      'personFields': 'names,emailAddresses',
    });
  } catch (err) {
    document.getElementById('content').innerText = err.message;
    return;
  }
  const connections = response.result.connections;
  if (!connections || connections.length == 0) {
    document.getElementById('content').innerText = 'No connections found.';
    return;
  }
  const output = connections.reduce(
      (str, person) => {
        if (!person.names || person.names.length === 0) {
          return `${str}Missing display name\n`;
        }
        return `${str}${person.names[0].displayName}\n`;
      },
      'Connections:\n');
  document.getElementById('content').innerText = output;
}
```", 'Q: People API의 공식 문서 URL은 무엇인가요?
A: People API의 공식 문서 URL은 [https://developers.google.com/people?hl=ko](https://developers.google.com/people?hl=ko)입니다.']

['Q: Google Cloud 세션 제어 기능이란 무엇이며, 어떤 영향을 미치나요?
A: Google Cloud 세션 제어 기능을 사용하여 사용자가 GCP 리소스에 액세스하는 동안 사용자의 재인증을 자주 요구할 수 있습니다. 이 정책은 Google Cloud Console, Google Cloud SDK (gcloud CLI라고도 함), Cloud Platform 범위가 필요한 서드 파티 OAuth 애플리케이션에 대한 액세스에 영향을 미칩니다.', 'Q: Google Cloud 세션 제어 기능이란 무엇이며, 어떤 영향을 미치나요?
A: GCP 조직의 관리자는 Google Cloud 세션 제어 기능을 사용하여 사용자가 GCP 리소스에 액세스하는 동안 사용자의 재인증을 자주 요구할 수 있습니다. 이 정책은 Google Cloud Console, Google Cloud SDK (gcloud CLI라고도 함), Cloud Platform 범위가 필요한 서드 파티 OAuth 애플리케이션에 대한 액세스에 영향을 미칩니다.', 'Q: Google Cloud Platform에서 세션 관리 정책이 적용되면 API 호출에 어떤 오류가 발생하나요?
A: 사용자에게 세션 제어 정책이 적용되어 있는 경우 세션 기간이 만료되면 갱신 토큰이 취소된 경우와 마찬가지로 API 호출에 오류가 발생합니다. 호출이 오류 유형 invalid_grant로 실패합니다.', 'Q: Google Cloud Platform API에서 관리자가 설정한 세션 길이를 초과하면 어떤 오류가 발생하나요?
A: Google Cloud Platform API의 경우 관리자가 설정한 세션 길이가 초과되면 API 호출에 오류가 발생합니다. 호출이 오류 유형 invalid_grant로 실패하며, error_subtype 필드를 사용하여 취소된 토큰과 세션 제어 정책으로 인한 실패를 구분할 수 있습니다.', 'Q: 세션 제어 정책이 적용된 경우, 사용자 인증 정보를 서버에 배포하면 어떤 문제가 발생하나요?
A: 사용자 인증 정보를 서버에 배포하면, 고객이 이러한 사용자에게 세션 제어 정책을 적용하는 경우 세션 기간이 만료될 때 사용자를 다시 인증할 방법이 없으므로 서버 애플리케이션이 실패하게 됩니다.', 'Q: 세션 기간이 만료되었을 때 사용자 인증 정보를 서버에 배포하면 어떤 문제가 발생하나요?
A: 사용자 사용자 인증 정보가 장기 실행 작업 또는 작업을 위해 서버에 배포되고 고객이 이러한 사용자에게 세션 제어 정책을 적용하는 경우 세션 기간이 만료될 때 사용자를 다시 인증할 방법이 없으므로 서버 애플리케이션이 실패합니다.', 'Q: 차단 함수에서 사용자의 세션 클레임(sessionClaims)을 설정하는 방법은 무엇인가요?
A: 차단 함수에서 사용자의 세션 클레임(sessionClaims)을 설정하려면, 사용자가 로그인할 때 IP 주소를 추적하고 이를 세션 클레임으로 설정할 수 있습니다. 예를 들어, 다음과 같이 구현할 수 있습니다.
```javascript
export const beforesignedin = beforeUserSignedIn((event) => {
    return {
        sessionClaims: {
            signInIpAddress: event.ipAddress,
        }
    };
});
```', 'Q: 세션 쿠키를 인증한 후 권한 확인을 어떻게 수행하나요?
A: 세션 쿠키를 인증한 후, 사용자 권한을 확인하기 위해 `decodedClaims`에서 특정 클레임을 확인합니다. 예를 들어, `if (Boolean.TRUE.equals(decodedToken.getClaims().get("admin")))`를 사용하여 사용자가 관리자 권한을 가지고 있는지 확인할 수 있습니다.']

['Q: Cloud Firestore에서 문서 변경 시 트리거되는 이벤트를 처리하기 위해 Cloud Functions를 어떻게 설정하나요?
A: Cloud Functions를 사용하면 코드를 배포하여 Cloud Firestore 데이터베이스의 변경을 통해 트리거되는 이벤트를 처리할 수 있습니다. 이를 위해 Cloud Functions for Firebase(2세대)를 사용하여 더 강력한 인프라와 성능을 활용할 수 있습니다.', "Q: Cloud Firestore 데이터 내보내기를 위한 Cloud Functions를 설정하는 방법은 무엇인가요?
A: Cloud Firestore 데이터 내보내기를 시작하는 Node.js Cloud 함수를 설정하려면 Firebase CLI를 설치한 후, 새 디렉터리에서 Cloud Functions용 CLI를 초기화하고, JavaScript를 선택한 후, functions/index.js 파일의 코드를 다음과 같이 바꿉니다.

```javascript
.schedule('every 24 hours')
.onRun((context) => {

return client.exportDocuments({
name: databaseName,
outputUriPrefix: bucket,
// 여기서 YOUR_PROJECT_ID를 프로젝트 ID로 바꿉니다.
// every 24 hours를 수정하여 내보내기 일정을 설정합니다.
// AppEngine cron.yaml 구문 또는 unix-cron 형식을 사용합니다.
// 지정된 컬렉션 그룹만 내보내도록 collectionIds: []를 수정합니다.
});
});
```", 'Q: Python에서 Cloud Firestore를 비동기적으로 초기화하는 방법은 무엇인가요?
A: Python에서 Cloud Firestore를 비동기적으로 초기화하려면 다음 코드를 사용합니다:

```python
import firebase_admin
from firebase_admin import firestore_async

# Application Default credentials are automatically created.
app = firebase_admin.initialize_app()
db = firestore_async.client()
```', 'Q: Cloud Firestore에서 문서의 모든 변경사항에 대해 함수 트리거를 설정하는 방법은 무엇인가요?
A: 다음은 사용자가 생성, 업데이트 또는 삭제될 때 실행되는 함수의 예시입니다.

```python
from firebase_functions.firestore_fn import (
    on_document_written,
    Event,
    Change,
    DocumentSnapshot,
)

@on_document_written(document="users/{userId}")
def myfunction(event: Event[Change[DocumentSnapshot | None]]) -> None:
    # Get an object with the current document values.
    # If the document does not exist, it was deleted.
    document = (event.data.after.to_dict()
    if event.data.after is not None else None)

    # Get an object with the previous document values.
    # If the document does not exist, it was newly created.
    previous_values = (event.data.before.to_dict()
    if event.data.before is not None else None)

    # Perform more operations ...
```', "Q: Cloud Firestore에서 새 문서를 추가할 때 자동으로 문서 식별자를 생성하는 방법은 무엇인가요?
A: 새 문서를 추가할 때 Cloud Firestore에서 자동으로 문서 식별자를 생성하려면 다음과 같은 코드를 사용할 수 있습니다.

```javascript
db.collection('컬렉션 이름').add({
  필드1: '값1',
  필드2: '값2'
});
```", 'Q: Cloud Firestore에서 문서가 업데이트될 때 트리거되는 함수를 작성하는 방법은 무엇인가요?
A: 다음은 사용자가 프로필을 변경하면 실행되는 함수의 예시입니다.

```python
from firebase_functions.firestore_fn import (
    on_document_updated,
    Event,
    Change,
    DocumentSnapshot,
)

@on_document_updated(document="users/{userId}")
def myfunction(event: Event[Change[DocumentSnapshot]]) -> None:
    # Get a dictionary representing the document
    # e.g. {'name': 'Marie', 'age': 66}
    new_value = event.data.after.to_dict()

    # Access a particular field as you would any dictionary
    name = new_value["name"]

    # Perform more operations ...
```', 'Q: Cloud Firestore에서 JavaScript를 사용하여 ID를 자동으로 생성하여 문서를 추가할 때 사용하는 코드 예시는 무엇인가요?
A: 다음은 JavaScript에서 ID를 자동으로 생성하여 문서를 추가하는 코드 예시입니다.

```javascript
import { collection, addDoc } from "firebase/firestore";

await addDoc(collection(db, "cities"), data);
```', "Q: Firestore에서 Cloud Functions를 사용하여 특정 문서의 변경을 감지하는 방법은 무엇인가요?
A: 특정 문서의 변경을 감지하려면 다음과 같이 Firestore 트리거를 정의할 수 있습니다. 문서 경로와 이벤트 유형을 지정합니다.

```javascript
const functions = require('firebase-functions');

exports.myFunction = functions.firestore
document('my-collection/{docId}')
.onWrite((change, context) => { /* ... */ });
```"]

