response:
Firestore의 'users' 컬렉션에서 모든 데이터를 가져오는 방법은 사용하는 프로그래밍 언어에 따라 다릅니다. 아래에 몇 가지 예제를 제공합니다.

1. **Python**:
   ```python
   users_ref = db.collection("users")
   docs = users_ref.stream()

   for doc in docs:
       print(f"{doc.id} => {doc.to_dict()}")
   ```

2. **C# (Unity)**:
   ```csharp
   CollectionReference usersRef = db.Collection("users");
   usersRef.GetSnapshotAsync().ContinueWithOnMainThread(task =>
   {
       QuerySnapshot snapshot = task.Result;
       foreach (DocumentSnapshot document in snapshot.Documents)
       {
           Debug.Log(String.Format("User: {0}", document.Id));
       }
   });
   ```

3. **Ruby**:
   ```ruby
   users_ref = firestore.col "users"
   users_ref.get do |user|
     puts "#{user.document_id} data: #{user.data}."
   end
   ```

4. **PHP**:
   ```php
   $usersRef = $db->collection('samples/php/users');
   $snapshot = $usersRef->documents();
   foreach ($snapshot as $user) {
       printf('User: %s' . PHP_EOL, $user->id());
       printf('First: %s' . PHP_EOL, $user['first']);
       if (!empty($user['middle'])) {
           printf('Middle: %s' . PHP_EOL, $user['middle']);
           printf('Born: %d' . PHP_EOL, $user['born']);
       }
   }
   ```

이 예제들을 참고하여 원하는 언어로 'users' 컬렉션의 모든 문서를 가져올 수 있습니다.

reference:
Firestore에서 users 콜렉션의 모든 users 정보를 가져오려면 다음과 같은 코드를 사용할 수 있습니다:

```javascript
await db.collection("users").get().then((event) => {
    for (var doc in event.docs) {
        print("${doc.id} => ${doc.data()}");
    }
});
```
